export default class App extends React.Component {
  render() {
    return (
      <React.Fragment>
        <CounterContextProvider>
          <Incrementer/>
          <Counter />
          <Decrementer/>
        </CounterContextProvider>
      </React.Fragment>
    );
  }
}
